import { Link } from "react-router-dom";
import { Button } from "reactstrap";
const Home = () => {
  const openNav = () => {
    document.querySelector("mySideBar").style.width = "250px";
    document.querySelector("main").style.marginLeft = "250px";
  };
  const closeNav = () => {
    document.querySelector("mySideBar").style.width = "0";
    document.querySelector("main").style.marginLeft = "0";
  };
  return (
    <div className="mt-5" id="intro">
      {/* <Button variant="primary" onClick={openNav}>
        Open SideBar
      </Button> */}
      <div className="hd grid grid-cols-1 gap-10">
        <div className="">
          <h2 className="mt-3">Osaid Kamal,</h2>
          <h2 className="">Full Stack Developer</h2>
          <p className="mt-4">
            Hi , I am Osaid i build scalable web applications using <br />
            Spring and Python as backend.
          </p>
          <Link class="resume" to="./OsaidCV-19" target="_blank" download>
            Download Resume
          </Link>
        </div>
        <div class="d-flex col-md-8 logo d-flex">
          <img
            className="logo d-flex"
            src={require("./logo.jpg")}
            alt={"Carlie Anglemire"}
          />
        </div>
      </div>
    </div>
  );
};
export default Home;
